import { useState } from "react";

export const NavBar = () => {
  const [handleShow, setHandleShow] = useState(false);
  return (
    <div className="nav-seciton">
      <div
        id="mySidepanel"
        className={handleShow ? "sidepanel show" : "sidepanel dont-show"}
      >
        <a className="nav-link" href="/calculator">
          <div className="nav-text">
            <i className="icon-size bi bi-calculator"></i>{" "}
            <p className="nav-content">Calculator</p>
          </div>
        </a>

        <a className="nav-link" href="/messages">
          <div className="nav-text">
            <i className="icon-size bi bi-chat-right-dots-fill"></i>{" "}
            <p className="nav-content">messages</p>
          </div>
        </a>
        <a className="nav-link">
          <div className="nav-text">
            <i className=" icon-size bi bi-file-earmark"></i>{" "}
            <p className="nav-content">Documents</p>
          </div>
        </a>
        <a href="/page">
          <div className="nav-text">
            <i className="icon-size bi bi-house-door-fill"></i>{" "}
            <p className="nav-content"> Page</p>
          </div>
        </a>
        <a href="/test_table">
          <div className="nav-text">
            <i className="icon-size  bi bi-table"></i>{" "}
            <p className="nav-content"> testTable</p>
          </div>
        </a>
      </div>
      <button
        className="openbtn"
        onClick={() => {
          setHandleShow(!handleShow);
        }}
      >
        â˜°
      </button>
    </div>
  );
};
